import React from "react";
import Form from 'react-bootstrap/Form'

function FormInput() {
  return (
    
    <Form>
      <Form.Group className="mb-3" controlId="exampleForm.ControlInput1" style={{display:'flex',justifyContent:"space-between",padding:'10px'}}>
        <Form.Label>Title</Form.Label>
        <Form.Control type="text" placeholder="title" />
      </Form.Group>
      <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1" style={{display:'flex',justifyContent:'space-between'}}>
        <Form.Label>Opening Text</Form.Label>
        <Form.Control as="textarea" rows={3} />
      </Form.Group>
      <button>ADD MOVIES</button>
    </Form>
  );
}

export default FormInput;
